function ifScript() {
	var listItems = new GlideRecord('x_655585_whmg_list_items');
	var item = new GlideRecord('sc_cat_item');
	item.addQuery('name', current.short_description);
	item.query();
	item.next();
	listItems.addQuery('item', item.sys_id);
	listItems.query();
	if(listItems.next())
		return 'yes';
	else
		return 'no';
}

